import React from 'react';
import nirvana from '../images/nirvana.jpg'

class Canciones extends React.Component{
    render (){
        return (
            <div className="alert alert-primary" role="alert">
                <img src={nirvana}  width="30px" height= "30px" alt=""/>    
                <p className="d-inline-block " id="Cancion__texto">Nirvana 3:56 </p>
                <p className="d-inline-block " id="Autor__texto">Nirvana 3:56 </p>
               </div>
        )
    }
}
export default Canciones;
